import React from 'react';
import './Footer.css';
import logo from '../Assets/Logo.svg'
import {Link} from "react-router-dom";

const Footer = () => {
    return (
        <div className='footer'>
            <div className='footer-logo'>
                <Link to={'/'}>
                    <img src={logo} alt='nav-logo'/>
                </Link>
            </div>
            <div className="footer-name">ElectroMart</div>
            <ul className='footer-list'>
                <li><Link className='footer-link' to={'/'}>Products</Link></li>
                <li><Link className='footer-link' to={'/search'}>Search</Link></li>
                <li><Link className='footer-link' to={'/cart'}>Cart</Link></li>
                <li><Link className='footer-link' to={'/login'}>Login</Link></li>
                <li><Link className='footer-link' to={'/register'}>Register</Link></li>
            </ul>
            <div className="copyright">Copyright © </div>
        </div>
    )
}

export default Footer;
